class Solution {
public:
    #define ii pair<long long,int>
    #define st first
    #define nd second
    ii A[501][501];
    vector<int> ds[501];
    long long ans; 
    long long maximumValueSum(vector<vector<int>>& board) {
        int n=board.size();
        int m=board[0].size();
        for(int i=0; i<n; i++){
            for(int j=0; j<m; j++){
                A[i][j]={board[i][j],j};
            }
            sort(A[i],A[i]+m,greater<ii>());
        }
        ans=-1e18;
        for(int i=0; i<n; i++){
            for(int j=i+1; j<n; j++){
                for(int z=j+1; z<n; z++){
                    for(int p1=0; p1<3; p1++){
                        for(int p2=0; p2<3; p2++){
                            for(int p3=0; p3<3; p3++){
                                if(A[i][p1].nd!=A[j][p2].nd && A[i][p1].nd!=A[z][p3].nd && A[j][p2].nd!=A[z][p3].nd){
                                    ans=max(ans,A[i][p1].st+A[j][p2].st+A[z][p3].st);
                                }
                            }
                        }
                    }
                }
            }
        }
        return ans;
    }
};
